import React from "react";
import { Nav, NavLink, NavMenu } 
    from "./NavbarElements";
  
const Navbar = () => {
  return (
    <>
      <Nav>
        <NavMenu>
          <NavLink to="/Espace_administration" activeStyle>
            Espace Administration
          </NavLink>
          <NavLink to="/Espace_Jurys" activeStyle>
            Espace Jurys 
          </NavLink>
          <NavLink to="/Espace_Superviseur" activeStyle>
           Espace Superviseur 
          </NavLink>
          
          
        </NavMenu>
      </Nav>
    </>
  );
};
  
export default Navbar;
